void bubbleSort(int * array, int size) {
	bool all_sorted = false;

	for (int n = size - 1; all_sorted && n > 0; n--) {
		all_sorted = true;

		for (int i = 0; i < size; i++) {
			if (array[i] > array[i+1]) {
				int aux = array[i];
				array[i] = array[i+1];
				array[i+1] = aux;
				all_sorted = false;
			}
		}
	}
}

